import FadeInSection from "./fading";

export default function Projects(){
// This data contains a list of all projects data added to the Projects section on the website 
    const data = [
    {
        id: 1,
        img: "/assets/wc.png",
        year: "May 2021",
        title: "Summarizing Stance Dependent Claims on Twitter",
        desc: " In this paper, I look at extracting the claims that summarise the opinions of tweets posted by users \
        about a specific target.",
        git :"https://github.com/willianck/Thesis",
        skills: ["Python","Sklearn","FlairNLP","Pytorch","Spacy","NLTK","Gensim","Pandas"],
        style: {
            "transitionDelay": "300ms"
        }
    },

    {
        id: 2,
        img: "/assets/farm.png",
        year: "May 2021",
        title:"Predicting Food Insecurity in Low-income countries",
        desc: "fweggghr  sunt in culpa qui officia deserunt mollit anim id est laborum.",
        git:'https://github.com/willianck/ADS',
        skills: ["Python","Sklearn","Plotly","Pandas","Matplotlib","Seaborn"],
        featured: true,
        style: {
            "transitionDelay": "500ms"
        }


    },

    {
        id: 3,
        img: "/assets/sceemspace.jpg",
        year:"May 2020",
        title: "SCEEM SPACE",
        desc:"  eu fugiat nulla pariatur. Excepteur sint occaecat cupidatat non proident, sunt in culpa qui officia deserunt mollit anim id est laborum.",
        git:"https://github.com/willianck/SCEEMSPACE",
        skills: ["Java Spring","MySQL","HTML","CSS","JavaScript"],
        style: {
            "transitionDelay": "100ms"
        }
    }
]








    return (
        <div className = "projects" id = 'projects'>
            <FadeInSection>
            <h1><i class="fas fa-code"></i> Projects</h1>
            </FadeInSection>
            <div className='container'>
                <ul className='items-grid'>
                  {data.map((d)=>(

                <FadeInSection style={d.style}>
                <li className ="items">
                        <div className ='top'>
                            <div className='folder-icon'>
                                <i class="far fa-folder"></i>
                            </div>
                            <div className='link-icon'>
                                <a href={d.git}><i class="fab fa-github"></i></a>
                            </div>


                         </div>
                        <div className='item-title'>
                            {d.title}
                        </div>
                        <div className='item-desc'>
                            {d.desc}
                        </div>

                        <ul className='item-tech'>

                        {d.skills.map((s)=> <FadeInSection> <li>{s}</li> </FadeInSection>

                        )}

                        </ul>
                 </li>
                 </FadeInSection>
                ))}
                </ul>

            </div>
        </div>
    );
}
